import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Home = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8000/api/robots/')
            .then((response) => response.json())
            .then((data) => setData(data.data.splice(0, 10)))

    }, [])

    return (
        <ProductContainer>
            <ProductsSection>
                <ul>
                    {data.map((item) => {
                        return <li key={Math.random().toString(36).substr(2, 9)}>
                            <div>
                                <image />
                                <h3>{item.name}</h3>
                                <h4>{item.price}</h4>
                                <h4>{item.stock}</h4>
                                <h4>{item.created}</h4>
                            </div>

                            {item.name}</li>
                    })}
                </ul>

            </ProductsSection>

            <CartSection>

            </CartSection>

        </ProductContainer>
    )
}

const ProductContainer = styled.div`
    display: flex;
    justify-content: space-between;
    background: #fff;
    height: 100vh;
    padding: 1rem 1rem;
`;

const ProductsSection = styled.div`
    width: 80%;
    height: 100vh;
    background: #F8F9F9 ;
`;

const CartSection = styled.div`
    width: 20%;
    height: 100vh;
    background: #F8F9F9 ;
    border-left: 1px solid #D5D8DC ;
`;


export default Home;
